import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';
import AdminMenu from '../components/AdminMenu';
import {useDispatch, useSelector} from 'react-redux'
import { toast } from "react-toastify";
import * as yup from "yup";
import { useFormik } from "formik";
let schema = yup.object().shape({
    name: yup.string().required("name is Required"),
    email: yup.string().email("Email is wrong").required("email is Required"),
    mobile: yup.string().required("mobile is Required"),
    address: yup.string().required("address is Required"),
    password: yup.string().required("password is Required"),
});
export default function AddUser() {
    const dispatch = useDispatch()
    const formik = useFormik({
    initialValues: {
        // enableReinitialize:true,
        name: "",
        email: "",
        mobile: "",
        password: "",
        address: "",
    },
    validationSchema: schema,
    onSubmit: (values) => {
        if(getCouponId !== undefined){
            // const data = {_id : getCouponId,couponData : values}
            // dispatch(updateCoupon(data))
            toast.success("Coupon Updated Successfullly!");
            // navigate("/admin/list-coupon");
        }else{
            // dispatch(createCoupons(values));
            formik.resetForm();
            setTimeout(() => {
            // dispatch(resetState())
            // navigate('/admin/list-coupon')
            }, 300);
        }
        },
    });
    return (
    <>
        <div className='container-fluid p-3' style={{minHeight:"90vh"}}>
            <div className='row'>
                <div className='col-md-3'>
                    <AdminMenu/>
                </div>
                <div className='col-md-9'>
                    <h3 className='mb-4 title'>Add User</h3>
                    <div className="">
                        <form action="" onSubmit={formik.handleSubmit}>
                            <CustomInput 
                                type ="text" 
                                label ="Enter Name"
                                onchange={formik.handleChange("name")}
                                onBlur={formik.handleBlur("name")}
                                val={formik.values.name}
                                />
                            <div className="error">
                                {formik.touched.name && formik.errors.name}
                            </div>
                            <CustomInput 
                                type ="text" 
                                label ="Enter email"
                                onchange={formik.handleChange("email")}
                                onBlur={formik.handleBlur("email")}
                                val={formik.values.email}
                                />
                            <div className="error">
                                {formik.touched.email && formik.errors.email}
                            </div>
                            <CustomInput 
                                type ="password" 
                                label ="Enter password"
                                onchange={formik.handleChange("password")}
                                onBlur={formik.handleBlur("password")}
                                val={formik.values.password}
                                />
                            <div className="error">
                                {formik.touched.password && formik.errors.password}
                            </div>
                            <CustomInput 
                                type ="text" 
                                label ="Enter mobile"
                                onchange={formik.handleChange("mobile")}
                                onBlur={formik.handleBlur("mobile")}
                                val={formik.values.mobile}
                                />
                            <div className="error">
                                {formik.touched.mobile && formik.errors.mobile}
                            </div>
                            <CustomInput 
                                type ="text" 
                                label ="Enter address"
                                onchange={formik.handleChange("address")}
                                onBlur={formik.handleBlur("address")}
                                val={formik.values.address}
                                />
                            <div className="error">
                                {formik.touched.address && formik.errors.address}
                            </div>
                            <button type='submit' className='btn btn-success border-0 rounded-3 my-5'>
                                Add User
                            </button>
                        </form>
                    </div>
                </div>
            </div>
        </div> 
    </>
  )
}
